import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import notesData from '../notes'
// console.log(notesData); 


function App() {
    return (
    <div >
            <Header />

        {
            notesData.map((cardData) => {
                return ( <
                    Note key = {
                        cardData.id
                    }
                    title = {
                        cardData.title
                    }
                    content = {
                        cardData.content
                    }
                    /> 
                )
            })
        }
        <Footer />

        </div>
    );
}

export default App;
